import { RechartsDevtools } from '@recharts/devtools';

type DataEntry = {
  x: number;
  y: number;
  z?: number;
};

// #region Sample data
const data: DataEntry[] = [
  { x: 100, y: 200, z: 200 },
  { x: 120, y: 100, z: 260 },
  { x: 170, y: 300, z: 400 },
  { x: 140, y: 250, z: 280 },
  { x: 150, y: 400, z: 500 },
  { x: 110, y: 280, z: 200 },
];

const getMeanValue = (o: ReadonlyArray<DataEntry>) => {
  const len = o.length;

  if (!len) {
    return null;
  }

  return o.reduce(
    (result: DataEntry, entry: DataEntry) => ({
      x: result.x + (entry.x || 0) / len,
      y: result.y + (entry.y || 0) / len,
    }),
    { x: 0, y: 0 },
  );
};

